script: |
  super -f text -I q5156.spq | sort > q5156.out

inputs:
  - name: q5156.spq
    data: |
      SELECT DISTINCT + 55 FROM tab0 (FORMAT parquet) AS cor0 CROSS JOIN tab1 (FORMAT parquet) AS cor1 WHERE NOT NULL IS NOT NULL;
  - name: tab0
  - name: tab1

outputs:
  - name: q5156.out
    data: |
      55
